Given that "Pipe Dreams (1976 film)" was directed by someone named, let's assume the director's name is `John Doe` for the sake of this example. We would then construct a SPARQL query to find John Doe's birthplace and connect it back to Phillip Spaulding.

```sparql
PREFIX dbpedia: <http://dbpedia.org/>

# Find the director of Pipe Dreams (1976 film)
SELECT ?director WHERE {
  <http://dbpedia.org/resource/Pipe_Dreams_(1976_film)> <http://dbpedia.org/ontology/director> ?director .
}

# Assume the director's name is John Doe
WHERE { ?director = "John Doe" }

# Find the birthplace of John Doe which is a settlement
SELECT ?birthplace WHERE {
  ?director <http://dbpedia.org/ontology/birthPlace> ?birthplace .
  ?birthplace <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/class/yago/NationalEntity> . # Assuming birthplaces are national entities
}

# Find Phillip Spaulding's child who is both a fictional character and soap character
SELECT ?child WHERE {
  ?child <http://dbpedia.org/ontology/type> <http://dbpedia.org/ontology/FictionalCharacter>. 
  ?child <http://dbpedia.org/property/father> <http://dbpedia.org/resource/Phillip_Spaulding> .
}

# Combine the results to find the resident of the birthplace of the director
CONSTRUCT {
  ?result <http://dbpedia.org/ontology/residence> ?birthplace
} WHERE {
  ?child ?p1 . 
  ?director ?p2 . 
  ?birthplace rdfs:label ?residence .
  ?child <http://dbpedia.org/property/father> <http://dbpedia.org/resource/Phillip_Spaulding> .
  ?director <http://dbpedia.org/ontology/birthPlace> ?birthplace .
  ?residence = ?birthplace
}
```

